â 
INGREDIENTS:â 
6â€“10 pounds of fresh pumpkin (one smaller medium or two small pumpkins)â 
â 
INSTRUCTIONS:â 
Prepare your pumpkins by washing the outside under running water. This helps to make sure you donâ€™t get any dirt or other derbis in your homemade pumpkin puree.â 
Cut the stem end off of the pumpkin and then cut it in half horizontally to make two pumpkin â€œbowlsâ€.â 
Scrape the seeds from inside the pumpkin (I like to make honey roasted pumpkin seeds with them!).â 
Flip the pumpkins over so the â€œbowlâ€ is upside down on a parchment or baking mat rimmed baking sheet).â 
Bake at 375 degrees until the flesh is very soft and can be pierced with a fork â€“ 30 to 40 minutes depending on the size of your pumpkin.â 
Remove from the oven and allow to cool enough to handle.â 
Use a spoon to scrape the flesh from the skin. Mash with a fork or for a truly smooth homemade pumpkin puree, toss the cooked pumpkin flesh into a food processor or blender and process until smooth (this is the preferred method over just using a fork).â 
Store pumpkin puree in an air-tight container in the fridge for up to a week or in the freezer for up to 6 months.â 
â 
NOTES:â 
See the tips and tricks section in the post for all kinds of notes on what kinds of pumpkins to buy and more.â 
